import { Button } from "./components/Button";

function App() {
  return (
    <div>
    <Button color="red">
      botão 1
    </Button>
    <Button color="blue">
      botão 2
    </Button>
    <Button color="black">
      botão 3
    </Button>
    </div>
  );
}

export default App;
